import React, { Component } from 'react';
import { Form, Button, Col, Container } from 'react-bootstrap';


export default function Login() {
    return (<Container>
        <Form>

            <Button variant="secondary">Back</Button>{' '}
            <Button variant="primary">Next</Button>
        </Form>
    </Container>
    );
}
